import React, { useState } from 'react'
import { Button } from 'react-bootstrap';
import HourlyChart from './Charts/HourlyChart';
import MinuteChart from './Charts/MinuteChart';
import '../App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const ChartData = () => {
  const [duration, setDuration] = useState('mins');
  const [chartType, setChartType] = useState('MS');

  return (
    <div>
      <Container>
        <Row>
          <Col className="border"></Col>
          <Col className="border"></Col>
        </Row>
        <Row>
          <Col className="border"></Col>
        </Row>
      </Container>
      <div className='buttonBox'>
        <Button
          variant="primary"
          onClick={() => { setDuration('hour') }}
          disabled={duration == 'hour'}
          className="timeButton">
          Hour
        </Button>
        <Button
          variant="primary"
          onClick={() => { setDuration('mins') }}
          disabled={duration == 'mins'}
          className="timeButton">
          Minutes
        </Button>
      </div>
      <button onClick={() => { setChartType('MS') }}>Moisture Sunlight</button>
      <button onClick={() => { setChartType('TH') }}>Temp Humidity</button>
      <button onClick={() => { setChartType('R') }}>Reservoir</button>
      {duration}
      {chartType}
      {
        duration == 'hour' ?
          chartType == 'MS' ?
            <HourlyChart type='MS' />
            : chartType == 'TH' ?
              <HourlyChart type='TH' />
              : <HourlyChart type='R' />
          : chartType == 'MS' ?
            <MinuteChart type='MS' />
            : chartType == 'TH' ?
              <MinuteChart type='TH' />
              : <MinuteChart type='R' />
      }
    </div>
  )
}

export default ChartData
